import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import DoctorList from "./DoctorList";
import LoginForm from "./LoginForm";

const App = () => (
  <Router>
    <Routes>
      <Route path="/" element={<LoginForm/>} />
      <Route path="/doctors" element={<DoctorList />} />
    </Routes>
  </Router>
);

export default App;
